import "./css/Gallery.css"
import "./Gallery.js"



function Gallery() {

  function open(event){
    event.preventDefault();
    const target = event.target.getAttribute("href");
    setPage(target);
  }


  return (
    <div className="columns">
      <div className="text1">text111111111</div>
      <div className="text2">text222222222</div>
      <div className="text3">text333333333</div>
      <button className="button">button</button>
    </div>



  );
}

export default Gallery;
